style.css:
@-moz-document domain("www.roblox.com"), url-prefix("http://roblox.com/") {
/*
__Colores__
Black: rgba(0,0,0,1)
NeonGreen: rgba(52,252,76,1)
ProfileGreen: rgba(0,100,25,1)
*/

/*TopBar, LeftBar, FooterBar, Robux Menu, etc*/
#game-instances, .btr-game-main-container, #buy-robux-popover-menu, #footer-container, .container-fluid, .rbx-left-col, .simplebar-content-wrapper, #btr-navbar-friends > .rbx-menu-item, #btr-navbar-messages > .rbx-menu-item{
    background-color: rgba(0,0,0,1)!important;
}

/*Messages*/
.rbx-tab-heading{
  background-color:rgba(0,0,0,1)!important;
  box-shadow: inset 0 -4px 0 0 rgba(52,252,76,1);
}
.avatar-card-content, #store, #rbx-recent-server-box > .stack-row, .rbx-game-server-item > .card-item, .border-top.sub-divider-bottom.messageDivider.roblox-message-row.ng-scope.unread,.border-top.sub-divider-bottom.messageDivider.roblox-message-ro.wng-scope{
  background-color:rgba(20,20,20,1)!important;
  border-color:rgba(52,252,75,1);
}

.avatar-card-btns, .section-content-off,.border-top.sub-divider-bottom.messageDivider.roblox-message-row.ng-scope.read {
  background-color:rgba(0,0,0,1)!important;
  border-color:rgba(52,252,75,1)
}

.border-top.sub-divider-bottom.messageDivider.roblox-message-row.ng-scope {
  background-color:rgba(0,0,0,1);
  border-color:rgba(52,252,75,1);
}

/*Perfil*/
.rbx-divider {
	background-color:rgba(52,252,76,1)!important;
  box-shadow: 0 0 10px rgba(52, 252, 76, 1), 0 0 20px rgba(52, 252, 76, 0.8), 0 0 30px rgba(52, 252, 76, 0.6), 0 0 40px rgba(52, 252, 76, 0.4), 0 0 50px rgba(52, 252, 76, 0.2);
}

/* Notificaciones */
.btn-uiblox-common-common-notification-bell-md {
  margin-right:10px!important;
}

#nav-message .notification-blue, #nav-friends .notification-blue, #notifications-bell-badge, #btr-navbar-friends .btr-nav-notif, #btr-navbar-messages .btr-nav-notif {
	background-color: #34fc4c!important;
  color: #000000!important;
  box-shadow: 0 0 10px rgba(52, 252, 76, 1), 0 0 20px rgba(52, 252, 76, 0.6), 0 0 30px rgba(52, 252, 76, 0.4);
}

/*BackGrounds*/
#container-main, .content, #wrap, .rbx-body{
    background-color:rgba(10,10,10,1)!important;
  	background-image: 
        repeating-linear-gradient(45deg, rgba(12 12, 12, 1) 0px, rgba(15, 15, 15, 1) 10px, transparent 10px, transparent 20px),
        repeating-linear-gradient(-45deg, rgba(12, 12, 12, 1) 0px, rgba(15, 15, 15, 1) 10px, transparent 10px, transparent 20px);
}



/* Thumbnails */
.thumbnail-2d-container, .ng-scope.ng-isolate-scope, .asset-thumb-container.ng-isolate-scope, .xsmall.notification-red.notification.ng-binding,.interaction-item{
  background-color:rgba(0,252,76,0.4)!important;
  box-shadow: 0 0 10px rgba(52, 252, 76, 1), 0 0 15px rgba(52, 252, 76, 0.4) ;
}

.profile-header:nth-child(1) > .section-content, .btr-profile-about > .section-content, #roblox-badges-container > .section-content, .btr-profile-playerbadges > .section-content, .btr-profile-groups > .section-content, #games-switcher, .btr-profile-favorites > .section-content{
	background-color:rgba(5,5,5,0.5)
}

/*Ads*/
#Skyscraper-Abp-Left, #Skyscraper-Abp-Right, #Leaderboard-Abp, .btr-feed{
	display:none!important;
}

/*RobuxCensor*/
#nav-robux-amount {
    position: relative;
    overflow: hidden;
    white-space: nowrap; 
}

#nav-robux-amount::before {
    content: "Censored";
    position: absolute;
    top: 0;
    left: 0;
    right: 0;
    bottom: 0;
    background-color: rgba(0,0,0,1); 
    z-index: 1;
  	font-size: 10px;
}

#navbar-stream::before {
  content: "Made by @System_CaliX";
  display: inline-block;
  width: 120px; 
  height: 25px; 
  background-color: rgba(52, 252, 76, 1);
  color: rgba(0, 0, 0, 1);
  box-shadow: 0 0 5px rgba(52, 252, 76, 0.8), 0 0 10px rgba(52, 252, 76, 0.6), 0 0 15px rgba(52, 252, 76, 0.4); 
  border-radius: 50px;
  font-size: 10px; 
  text-align: center; 
  line-height: 10px; 
}
#upgrade-now-button {
	background-color:rgba(0,0,0.1);
  border-color:rgba(52,252,76,1);
  color:rgba(52,252,76,1);
  box-shadow: 0 0 10px rgba(52, 252, 76, 1), 0 0 20px rgba(52, 252, 76, 0.6), 0 0 30px rgba(52, 252, 76, 0.4);
}


/* Definir la animación */
@keyframes cambioColor {
  0%, 100% {
    background-color: rgba(0, 100, 25, 1); /* Apagado: Verde oscuro */
    box-shadow: 0 0 10px 5px rgba(52, 252, 76, 0); /* Apagado: Sin efecto de borde de neón */
  }
  50% {
    background-color: rgba(52, 252, 76, 1); /* Encendido: Verde neón */
    box-shadow: 0 0 20px 10px rgba(0, 100, 25, 1); /* Encendido: Efecto de borde de neón */
  }
}

/* Aplicar la animación al botón */
.accept-friend, .btn-common-play-game-lg.btn-primary-md.btn-full-width {
  animation: cambioColor 3s infinite; /* Nombre de la animación, duración y repetición */
}
}
